import "./style.css";
import React from "react";
import {Button, Container, Form} from "semantic-ui-react";
import FeedbackForm from "../feedback-component/FeedbackForm";


const openFeedback = () => {
  return <FeedbackForm name='test' />;
};
function UserForm() {
  return (
    <Container className='main-container'>
      <Container className='form-container'>
        <Form>
          <Form.Field>
            <label>First Name</label>
            <input placeholder='First Name' />
          </Form.Field>
          <Form.Field>
            <label>Last Name</label>
            <input placeholder='Last Name' />
          </Form.Field>
          <Form.Field>
            <label>E-mail</label>
            <input placeholder='E-mail' />
          </Form.Field>
          <Button type='submit' onClick={openFeedback()}>
            Next
          </Button>
        </Form>
      </Container>
    </Container>
  );
}

export default UserForm;
